import './NewExpense.css'

import ExpenseForm from './ExpenseForm'

const NewExpense = (newExpenseProps) => {
    const expenseEntryHandler = (enteredExpenseData) => {
        const expenseData = {
            ...enteredExpenseData,
            id: Math.random().toString()
        }
        // onAddExpense is defined in App.js
        newExpenseProps.onAddExpense()
    }

    return (
        <div className='new-expense'>
            {/* onExpenseEntry EQUALS to ExpenseForm(expenseProps) */}
            <ExpenseForm onExpenseEntry={expenseEntryHandler} />
        </div>
    )
}

export default NewExpense
